// Demo program illustrating how to write 7 bit twice in a 10 bit WOM. (Rfixed=1.4)
// It uses "coset coding", with a predefined parity check matrix.
// The coding principle was derived from "Efficient Two-Write WOM-Codes" (Yaakobi et al) 
// Due to the relatively small size of the tables, I opted to store them as 'const's in this case, removing
// the table initialisation code and matrix processing. Only lookups remain.
// Idea is that this code is small enough for a direct lookup hardware implementation where speed is paramount.
// If the table is considered anyway too large, solving the linear system can be performed as in e.g. the <2^13>^2/18 example.
// Comments to bert.o.dobbelaere[at]telenet[dot]be

