// Encode the 1st write symbol into a pattern
u16 encode1(u8 s1)
{
	return symb_to_p[s1];
}

// Decode the 1st write symbol from a pattern
u8 decode1(u16 pattern)
{
	return p_to_symb[pattern];
}

// Encodes the 2nd write symbol in a pattern, knowing the pattern after 1st write
u16 encode2(u8 s2, u16 pattern1)
{
	u8 s1=p_to_symb[pattern1];
	
	assert(s1!=ERRP); // 1st write pattern must be valid
	
	return encode2_table[s1][s2];
}

// Decode the 2nd write symbol from a pattern
u8 decode2(u16 pattern)
{
	return syndrome[pattern];
}


int main()
{
	printf("\nThis example illustrates the encoding/decoding of a <(2^7),(2^7)>/10  WOM code.\n");
	printf("Assumption is that encoder and decoder know the write number.\n");
	
	
	// Test the encoding/decoding process
	printf("Testing our code by encoding/decoding random 7 bit values (hex):\n\n");
	printf("Encode 1      Pattern 1     Decode 1        Encode 2         Pattern 2     Decode 2\n\n");
	
	for(unsigned n=0;n<20;n++)
	{
		u16 s1_enc= rand()%NSYMBOLS;
		u16 s2_enc= rand()%NSYMBOLS;
	
		u16 pattern1=encode1(s1_enc);
		
		printf("e1(%02X)   =>   p1=%03X   ",s1_enc,pattern1);
		
		if(pattern1 >= NPATTERNS)
		{
			printf("\nERROR: 1st pattern invalid.\n");
			assert(0);
		}
		
		u16 s1_dec = decode1(pattern1);
		printf("=>   d1(p1)=%02X       ",s1_dec);
	
		if(s1_dec!=s1_enc)
		{
			printf("ERROR: 1st symbol decode failed !\n");
			assert(0);
		}
	
		u16 pattern2=encode2(s2_enc,pattern1);
		
		printf("e2(%02X,p1)   =>   p2=%03X",s2_enc,pattern2);
		
		if((pattern2 >= NPATTERNS) || ((pattern2&pattern1)!=pattern1) /* Check against "cheating" bits */)
		{
			printf("ERROR: 2nd pattern invalid.\n");
			assert(0);
		}
	
		u16 s2_dec = decode2(pattern2);
		printf("   =>   d2(p2)=%02X\n",s2_dec);
		if(s2_dec!=s2_enc)
		{
			printf("ERROR: 2nd symbol decode failed ! (Expected %04X, decoded %04X)\n",s2_enc, s2_dec);
			assert(0);
		}
	}
}




